import "./register.css"
import { useState } from "react";

const Register = () => {

    // states for firstname, lastname, street, postcode, city, country, phone, email, password, savedRecipes?
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [street, setStreet] = useState("");
    const [postcode, setPostcode] = useState(null);
    const [city, setCity] = useState("");
    const [country, setCountry] = useState("");
    const [phone, setPhone] = useState(null);
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    // onSignup

    return(
        <div className="Register__Container">
            <h3>Registrieren</h3>
            <div className="Register__Input">
                <label>Vorname: </label>                
                <input type="text" value={firstName} onChange={(e) => {setFirstName(e.target.value)}}/>
                <label>Nachname: </label>                
                <input type="text" value={lastName} onChange={(e) => {setLastName(e.target.value)}}/>
                <label>Stra√üe: </label>                
                <input type="text" value={street} onChange={(e) => {setStreet(e.target.value)}}/>
                <label>Postleitzahl: </label>                
                <input type="text" value={postcode} onChange={(e) => {setPostcode(e.target.value)}}/>
                <label>Stadt: </label>                
                <input type="text" value={city} onChange={(e) => {setCity(e.target.value)}}/>
                <label>Land: </label>                
                <input type="text" value={country} onChange={(e) => {setCountry(e.target.value)}}/>
                <label>Telefonnumme: </label>                
                <input type="text" value={phone} onChange={(e) => {setPhone(e.target.value)}}/>
                <label>E-Mail: </label>                
                <input type="email" value={email} onChange={(e) => {setFirstName(e.target.value)}}/>
                <label>Passwort: </label>                
                <input type="password" value={password} onChange={(e) => {setPassword(e.target.value)}}/>
            </div>
            <div className="Register__Buttons">
                <button className="Register__OnSignUpButton">Registrieren</button>
            </div>
        </div>
    )
};

export default Register;
